INSERT INTO `survey` VALUES (1,'TRACK儿童呼吸和哮喘控制测试','NA',242,30,1,37,602,'NA','TRACK 测试是一份为 5 岁以下儿童的照顾者设计的含有 5 项内容的标准化问卷调查，TRACK 测试关注哮喘控制的风险和 损伤问题，与当前的哮喘指南一致，该测试适合用于以下儿童:5 岁以下，并且有过发作≥ 2 次的喘息、呼吸短促，或持续 超过 24 小时的咳嗽病史，并且此前曾使用过支气管扩张剂治疗呼吸问题或曾被诊断患有哮喘。','2018-03-18 11:29:18','',1,6),(2,'哮喘新病例入组问卷（A1）','NA',19,90,1,1,142,'NA','萌宝呼卫队哮喘新病例入组问卷（新病例填写）。这份问卷将对您孩子目前对情况进行调查，有助于医生掌握您孩子目前对状况，为后续治疗提供指导。','2018-03-18 11:37:40','',1,6),(3,'哮喘既往病例入组问卷（A2）','NA',5,30,1,1,47,'NA','萌宝呼卫队哮喘病例入组问卷（既往病例填写）。这份问卷将对您孩子目前对情况进行调查，有助于医生掌握您孩子目前对状况，为后续治疗提供指导。','2018-03-18 12:15:32','',1,6),(4,'哮喘随访问卷（B）','NA',1006,30,1,36,773,'NA','萌宝呼卫队-哮喘随访问卷（B）。本问卷将记录您的孩子上个月的哮喘控制情况，为后续治疗提供知道。随访周期为每月一次。','2018-03-18 13:32:21','\0',1,6),(5,'儿童哮喘生命质量随访问卷','NA',155,30,6,7,878,'NA','本问卷问题请您根据孩子近1月来的情况作答。加强对哮喘儿童心理社会因素评估，合理选择心理护理和健康教育方法，最终使哮喘儿童形成认知与行为统一对健康行为趋向，可以全面完善哮喘儿童的生命质量。','2018-03-18 13:59:07','',1,6),(6,'哮喘控制测试评分','NA',221,30,1,37,582,'NA','C-ACT（哮喘控制测试）评分是哮喘治疗过程中监测和评估哮喘病情的有效工具，每4周（或1月）评估一次，对于调整治疗方案和巩固疗效非常有益；满分27分，分数越高，代表控制的越好。','2018-03-18 20:19:30','',1,6);
